import * as React from 'react';

import { PeopleContext } from './Provider';

const People = () => {
  return (
    <PeopleContext.Consumer>
      {context => {
        console.log(`"CTX consumed->"`, context);
        return <div />;
      }}
    </PeopleContext.Consumer>
  );
};

export default People;
